import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { Form } from 'react-bootstrap';

class LoginUsername extends Component {
    render() {
        return (
            <Form>
                <FormGroup
                    id="login"
                    type="text"
                    label="Text"
                    placeholder="Enter Username"
                />
            </Form>
        );
    }
}

export default LoginUsername;
